import CityLayout from "../components/CityLayout";

export default function Ehime() {
  return (
    <CityLayout
      imageUrl="/images/ehime-cable.jpeg"
      imageAlt="Ehime Station"
      region="愛媛縣"
      title="About Ehime"
      paragraphs={[
        "愛媛是一座充滿橘子活力與鯛魚香氣的城市。一路進便能感受到滿滿的鮮甜與熱情。市區距離海邊不到十五分鐘的路程，讓人隨時都能搭上路面電車，飽覽壯麗的海岸風光。",
        "當旅途的疲憊漸漸湧現時，不妨前往道後溫泉 —— 這座被譽為《神隱少女》湯屋原型的聖地，彷彿能引領你進入電影般奇幻的世界，在蒸氣氤氳中徹底釋放身心的重擔。"
      ]}
    />
  );
}
